	<div class="container-fluid text-center mt-5">
		<div id="root" class="d-flex justify-content-center p-4">
			<div class="bb shadow-sm" id="b1"><canvas class="border rounded" id="canvas" title="original outline">canvas not supported</canvas></div>
			<div class="btn-group-vertical">
			<input type="button" class="btn btn-outline-primary rounded" value="Texts: "/> 
			<input type="button" class="btn btn-outline-primary rounded" value="Card"/> 
			<input type="button" class="btn btn-outline-primary rounded" value="font"/> 
			<input type="button" class="btn btn-outline-primary rounded" value="Clear Text"/> 
			<input type="button" class="btn btn-outline-primary rounded" value="Save"/> 
			</div>
		</div>
		
		<div class="btn-group-vertical text-center mx-auto justify-content-spacing d-none">
			<input class="btn btn-outline-primary "  type="button" value="testing" id="test"  />
			<input class="form-control" type="text" id="txt" title="Enter your name here" value="Evelyn" />
		</div>
		
		<h5 id="h" class="fixed-bottom mb-5"></h5>
	</div>

	<script src="./js/card.js" ></script>
	<script src="https://oroafrica.github.io/store/js/fontFaceObserver.js" ></script>
	<script >
			var fontA = new FontFaceObserver('BrushSignature');
			var fontB = new FontFaceObserver('SoftSignature');
			Promise.all([fontA.load(),fontB.load()]).then(function () 
			{
			  console.log('fonts loaded');
			});
		$(document).ready(new Gift().render());
	</script>
